// Função auxiliar para converter valores corretamente
function parseCurrency(value) {
    return parseFloat(value.replace(/[^\d.-]/g, "")) || 0;
}

// Função para formatar em Dólar Canadense (CAD)
function formatCAD(value) {
    return new Intl.NumberFormat('en-CA', { style: 'currency', currency: 'CAD' }).format(value);
}

// Calcula o lucro líquido (Total Income - Total Expenses)
function calculateProfit() {
    let income = parseCurrency(document.getElementById("totalIncomeDisplay").innerText);
    let expenses = parseCurrency(document.getElementById("totalExpensesDisplay").innerText);

    let netProfit = income - expenses;
    let resultElement = document.getElementById("netProfitLossDisplay");

    resultElement.innerText = formatCAD(netProfit);
    resultElement.style.color = netProfit < 0 ? "red" : "green";
}

// Calcula automaticamente o total arrecadado (Funds for Event)
function calculateTotalIncome() {
    let total = 0;

    document.querySelectorAll(".fund-checkbox").forEach((checkbox, index) => {
        if (checkbox.checked) {
            let value = parseCurrency(document.querySelectorAll(".fund-value")[index].value);
            total += value;
        }
    });

    document.getElementById("totalIncomeDisplay").innerText = formatCAD(total);

    // Atualiza automaticamente o cálculo do lucro/prejuízo
    calculateProfit();
}

// Calcula automaticamente o total de despesas
function calculateTotalExpenses() {
    let totalExpenses = 0;

    document.querySelectorAll(".expense-value").forEach(expense => {
        totalExpenses += parseCurrency(expense.value);
    });

    document.getElementById("totalExpensesDisplay").innerText = formatCAD(totalExpenses);

    // Atualiza automaticamente o cálculo do lucro/prejuízo
    calculateProfit();
}

// Calcula automaticamente os custos cobertos pela igreja e o saldo final
function calculateChurchFunds() {
    let totalChurchFunds = 0;

    document.querySelectorAll(".church-funds-value").forEach(churchFund => {
        totalChurchFunds += parseCurrency(churchFund.value);
    });

    document.getElementById("totalChurchFundsDisplay").innerText = formatCAD(totalChurchFunds);

    let netProfitLoss = parseCurrency(document.getElementById("netProfitLossDisplay").innerText);

    let finalBalance = netProfitLoss + totalChurchFunds;
    let finalBalanceDisplay = document.getElementById("finalBalanceDisplay");

    finalBalanceDisplay.innerText = formatCAD(finalBalance);
    finalBalanceDisplay.style.color = finalBalance < 0 ? "red" : "green";
}

// Adiciona eventos para atualizar automaticamente os cálculos quando o usuário digitar valores ou marcar checkboxes
document.addEventListener("DOMContentLoaded", function () {
    document.querySelectorAll(".fund-value, .expense-value, .church-funds-value").forEach(input => {
        input.addEventListener("input", function () {
            calculateTotalIncome();
            calculateTotalExpenses();
            calculateChurchFunds();
        });
    });

    // Adiciona evento para os checkboxes da seção "Funds for Event"
    document.querySelectorAll(".fund-checkbox").forEach(checkbox => {
        checkbox.addEventListener("change", calculateTotalIncome);
    });
});

const { jsPDF } = window.jspdf;

function saveFormToLocalStorage() {
    const data = {
        eventTitle: document.getElementById("eventTitle").value,
        organizer: document.getElementById("organizer").value,
        eventDate: document.getElementById("eventDate").value,
        purposes: [],
        funds: [],
        expenses: [],
        churchFunds: [],
        approvals: [],
    };

    // Propósitos
    document.querySelectorAll(".purpose-checkbox").forEach((checkbox, index) => {
        data.purposes.push({
            checked: checkbox.checked,
            info: document.querySelectorAll(".purpose-info")[index].value,
        });
    });

    // Fundos
    document.querySelectorAll(".fund-checkbox").forEach((checkbox, index) => {
        data.funds.push({
            checked: checkbox.checked,
            info: document.querySelectorAll(".fund-info")[index].value,
            value: document.querySelectorAll(".fund-value")[index].value,
        });
    });

    // Despesas
    document.querySelectorAll(".expense-value").forEach((input, index) => {
        data.expenses.push({
            info: document.querySelectorAll(".expense-info")[index]?.value || "",
            value: input.value,
        });
    });

    // Fundos da igreja
    document.querySelectorAll(".church-funds-value").forEach((input, index) => {
        data.churchFunds.push({
            info: document.querySelectorAll(".church-funds-info")[index].value,
            value: input.value,
        });
    });

    // Aprovações
    document.querySelectorAll(".approval-checkbox").forEach((checkbox, index) => {
        data.approvals.push({
            checked: checkbox.checked,
            info: document.querySelectorAll(".approval-info")[index].value,
        });
    });

    localStorage.setItem("eventPlannerForm", JSON.stringify(data));
}

function loadFormFromLocalStorage() {
    const savedData = localStorage.getItem("eventPlannerForm");
    if (!savedData) return;

    const data = JSON.parse(savedData);

    document.getElementById("eventTitle").value = data.eventTitle || "";
    document.getElementById("organizer").value = data.organizer || "";
    document.getElementById("eventDate").value = data.eventDate || "";

    data.purposes?.forEach((item, index) => {
        document.querySelectorAll(".purpose-checkbox")[index].checked = item.checked;
        document.querySelectorAll(".purpose-info")[index].value = item.info;
    });

    data.funds?.forEach((item, index) => {
        document.querySelectorAll(".fund-checkbox")[index].checked = item.checked;
        document.querySelectorAll(".fund-info")[index].value = item.info;
        document.querySelectorAll(".fund-value")[index].value = item.value;
    });

    data.expenses?.forEach((item, index) => {
        document.querySelectorAll(".expense-info")[index].value = item.info;
        document.querySelectorAll(".expense-value")[index].value = item.value;
    });

    data.churchFunds?.forEach((item, index) => {
        document.querySelectorAll(".church-funds-info")[index].value = item.info;
        document.querySelectorAll(".church-funds-value")[index].value = item.value;
    });

    data.approvals?.forEach((item, index) => {
        document.querySelectorAll(".approval-checkbox")[index].checked = item.checked;
        document.querySelectorAll(".approval-info")[index].value = item.info;
    });

    // Recalcular totais após carregamento
    calculateTotalIncome();
    calculateTotalExpenses();
    calculateChurchFunds();
}

document.addEventListener("DOMContentLoaded", function () {
    loadFormFromLocalStorage();

    // Adiciona listeners para salvar em tempo real
    document.querySelectorAll("input, textarea, select").forEach(input => {
        input.addEventListener("input", () => {
            saveFormToLocalStorage();
        });
    });
});

function clearFormStorage() {
    localStorage.removeItem("eventPlannerForm");
    location.reload(); // Recarrega a página para limpar os campos
}

